import React from "react";

export default function Synonyms(props) {
  return (
    <div className="Synonyms">
      <p>Synonyms:</p>
      {props.synonyms.synonyms.map(function (synonym, index) {
        return <div key={index}>{synonym}</div>;
      })}
    </div>
  );
}
